msdyn_dataflow.msdyn_mashupdocument:
section Section1;
shared taxiData = let
  Source = Csv.Document(Web.Contents("https://amalitech-my.sharepoint.com/personal/charles_nkansah_amalitech_com/Documents/DE%20PowerAutomate/taxiData.csv"), [Delimiter = ",", Columns = 20, QuoteStyle = QuoteStyle.None]),
  #"Promoted headers" = Table.PromoteHeaders(Source, [PromoteAllScalars = true]),
  #"Changed column type" = Table.TransformColumnTypes(#"Promoted headers", {{"RateCodeID", Int64.Type}, {"RatecodeID", type text}, {"VendorID", Int64.Type}, {"dropoff_latitude", type number}, {"dropoff_longitude", type number}, {"extra", type number}, {"fare_amount", type number}, {"improvement_surcharge", type number}, {"mta_tax", type number}, {"passenger_count", Int64.Type}, {"payment_type", Int64.Type}, {"pickup_latitude", type number}, {"pickup_longitude", type number}, {"store_and_fwd_flag", type text}, {"tip_amount", type number}, {"tolls_amount", type number}, {"total_amount", type number}, {"tpep_dropoff_datetime", type datetime}, {"tpep_pickup_datetime", type datetime}, {"trip_distance", type number}}),
  #"Removed columns" = Table.RemoveColumns(#"Changed column type", {"RateCodeID", "RatecodeID"}),
  #"Filtered rows" = Table.SelectRows(#"Removed columns", each [dropoff_latitude] <> 0 and [dropoff_longitude] <> 0),
  #"Changed column type 1" = Table.TransformColumnTypes(#"Filtered rows", {{"dropoff_latitude", type text}, {"dropoff_longitude", type text}, {"pickup_latitude", type text}, {"pickup_longitude", type text}}),
 UniqueRecordsCount = Table.RowCount(Table.Distinct(#"Changed column type 1")),
    ErrorCount = Table.RowCount(Table.SelectRows(#"Changed column type 1", each [dropoff_latitude] = null or [dropoff_longitude] = null or [pickup_latitude] = null or [pickup_longitude] = null)),
    SummaryOfTransformations = Text.Combine({
        "Removed Columns: RateCodeID", 
        "Filtered Rows: dropoff_latitude and dropoff_longitude <> 0", 
        "Transformed Latitude and Longitude Columns to Text"
    }, "; "),
    ProfilingTable = Table.FromRows({
        {"Unique Records", Number.ToText(UniqueRecordsCount)},
        {"Error Count", Number.ToText(ErrorCount)},
        {"Transformation Summary", SummaryOfTransformations}
    }, {"Metric", "Value"}),
    Output = ProfilingTable
in
    Output;
